import { useContext } from "react";
import {  useLocation, useNavigate } from "react-router-dom";
import { AuthContext } from '../contexts/authContext';
import { Link } from "react-router-dom";
import PostButton from '../components/button/postButton'
import HomeButton from "../components/button/homeButton";
import ExploreButton from "../components/button/exploreButton";
import ProfileButton from "../components/button/profileButton";
import SettingsButton from "../components/button/settingsButton";

const Navbar = () => {
    const navigate = useNavigate();
    const { currentUser, logout } = useContext(AuthContext);
    const location = useLocation();

    const handleLogout = () => {
        logout();
        navigate('/login');
    }

    return(
        <div className='py-10 w-60 border-r border-stone-700 sticky top-0 
                        h-screen flex flex-col font-normal 
                        tracking-tight text-[22px]'>
            <ul className="flex flex-col gap-4">
                <li>
                    <HomeButton/>
                </li>
                <li>
                    <ExploreButton/>
                </li>
                <li>
                    <ProfileButton/>
                </li>
                <li>
                    <SettingsButton/>
                </li>
            </ul> 
            <PostButton onClick={() => {}}/>
            <div onClick={() => handleLogout()} className='justify-self-end row-start-5 w-5/6 hover:bg-stone-700 hover:cursor-pointer rounded-3xl py-2 px-6'>
                <p className="text-base">{currentUser.name}</p>
                <p className="text-base">Sair</p>
            </div>
        </div>
    )
}

export default Navbar;
